import React, { Component } from 'react';
import Message from './Message.js'

class MessageList extends Component {

  render() {
    return (
      <div>
        {(this.props.messages.length) ? this.props.messages.map((message, i) => {return <Message starMessage={this.props.starMessage} key={i} id={message.id} subject={message.subject} read={message.read} starred={message.starred} labels={message.labels}/>}) : "No messages"}
      </div>
    )
  }

}
export default MessageList;
